class CallAPICCCD {
  static Future<bool> getData({CancelToken? cancelToken}) async {
    try {
      /// Demo
      // await Future.delayed(Duration(seconds: 2));
      // AppDataGlobal.dataCCCDScan.value = CccdDataModel(
      //   eidNumber: '083099000524',
      //   fullName: 'Lê Thanh Tú',
      //   dateOfBirth: '18/03/1999',
      //   dateOfIssue: '05/04/2021',
      //   gender: 'Nam',
      //   placeOfResidence: '218A/1C, KP4, An Phú Đông, Quận 12, Hồ Chí Minh',
      //   faceOnCard:
      //       '',
      //   address: CccdAddressDataModel(
      //       address: '218A/1C',
      //       hamlet: 'KP4',
      //       ward: 'phường An Phú Đông',
      //       district: 'Quận 12',
      //       province: 'TP Hồ Chí Minh'),
      // );

      ///============
      var data = await CCCDGetDataAPI.get(cancelToken: cancelToken);
      if (data.data == null || data.code != '00') {
        await CustomPopup.showTextWithImage(Get.context,
            title: 'Ôi! Có lỗi xảy ra',
            message: data.message ??
                'Hệ thống không kiểm tra được thông tin của bạn. Vui lòng thử lại bạn nhé',
            titleButton: 'Đã hiểu',
            svgUrl: AssetSVGName.error);
        AppDataGlobal.dataCCCDScan.value = CccdDataModel(eidNumber: '');
        return false;
      }

      if(data.data?.eidNumber == '-1'){
        return false;
      }

      AppDataGlobal.dataCCCDScan.value =
          data.data ?? CccdDataModel(eidNumber: '');

      return true;
    } catch (e) {
      if (kDebugMode) {
        print('********* Error CallAPICCCD: $e *********');
      }
      AppDataGlobal.dataCCCDScan.value = CccdDataModel(eidNumber: '');
      return false;
    }
  }

  static Future<bool> faceVerify({
    required String transactionId,
    required String faceLink,
  }) async {
    try {
      var data = await VerifyFaceAPI.post(
          faceLink: faceLink, transactionId: transactionId);
      if (data?.data?.matching == null || data?.code != '00') {
        // await CustomPopup.showTextWithImage(Get.context,
        //     title: 'Ôi! Có lỗi xảy ra',
        //     message: data?.message ??
        //         'Hệ thống không kiểm tra được thông tin của bạn. Vui lòng thử lại bạn nhé',
        //     titleButton: 'Đã hiểu',
        //     svgUrl: AssetSVGName.error);
        AppDataGlobal.dataCCCDScan.value = CccdDataModel(eidNumber: '');
        return false;
      }

      double matching = data?.data?.matching ?? 0;
      return (matching >= 70);
    } catch (e) {
      if (kDebugMode) {
        print('********* Error faceVerify: $e *********');
      }
      AppDataGlobal.dataCCCDScan.value = CccdDataModel(eidNumber: '');
      return false;
    }
  }
}
